(24, 'Otello', 'Othello begins on a street in Venice, in the midst of an argument between Roderigo, a rich man, and Iago. Roderigo has been paying Iago to help him in his suit to Desdemona. But Roderigo has just learned that Desdemona has married Othello, a general whom Iago begrudgingly serves as ensign. Iago says he hates Othello, who recently passed him over for the position of lieutenant in favor of the inexperienced soldier Michael Cassio.', 'Have you pray\'d to-night, Desdemona? ', '', 'event_24.jpg', 2, 31, 0, '2008-08-01', '20:00:00', '19:30:00', 'unpub', 3, '', 'ticket_joel', 2, '', 'main,sub', 24, 'opera'),
